async function loadCalendar(){const e="https://p47-caldav.icloud.com/published/2/MTE2MDczODg2ODIxMTYwN5fOHGdykS4M-87toBH-6WGmDXZulQjFnJVwgThQa9XcAYk6tbFlcBP1YENQYurb_z6Ac37Begw8l4Td0Sr6NNQ";try{const n=await fetch(e),s=await n.text(),o=ICAL.parse(s),i=new ICAL.Component(o),a=i.getAllSubcomponents("vevent"),t=document.getElementById("calendar-events");t.innerHTML="",a.forEach(e=>{const s=e.getFirstPropertyValue("summary"),o=e.getFirstPropertyValue("dtstart").toJSDate(),i=e.getFirstPropertyValue("dtend").toJSDate(),n=document.createElement("div");n.innerHTML=`<strong>${s}</strong><br>${o.toLocaleString()} - ${i.toLocaleString()}`,t.appendChild(n)})}catch(e){console.error("Error loading calendar:",e)}}document.addEventListener("DOMContentLoaded",loadCalendar)